import * as actionTypes from "./constant";

const initialState = {
  loading: false,
  data: null,
  error: null,
};

export const restaurantListReducer = (
  state = initialState,
  { type, payload }
) => {
  switch (type) {
    case actionTypes.GET_RESTAURANT_LIST_REQUEST:
      state.loading = true;
      state.data = null;
      state.error = null;
    case actionTypes.GET_RESTAURANT_LIST_SUCCESS:
      state.loading = false;
      state.data = payload;
      state.error = null;
    case actionTypes.GET_RESTAURANT_LIST_FAILED:
      state.loading = false;
      state.data = null;
      state.error = payload;
    default:
      return { ...state };
  }
};
